import styled from "styled-components";

const MainScreen = styled.div`
    width: 90%;
    max-width: 1000px;
    margin: auto;
    display: grid;
    grid-template-columns: 15px 1fr 15px;
`;

const Menu = styled.div`
    background: pink;
    grid-column: span 3;
    display: flex;
    flex-direction: row-reverse;
    padding: 5px;
`;

export { MainScreen, Menu }
